import { Container, Nav } from "react-bootstrap";

const MainNavbar = () => {
  return (
      <Container>
    <Nav class="navbar navbar-dark bg-dark text-white">
    <h1>Expense Mangement System</h1>
  </Nav>
  </Container>
  );
};

export default MainNavbar;
